function Initialize(){
	audioData_spec = [];	//録音データ
	audioData_wave = [];	//録音データ
	max_volume=0;
	onFlag=0;
	// canvasの初期化
	//キャンバス情報の取得
	var canvas = document.getElementById('canvas');
	var canvasContext = canvas.getContext('2d');
	canvasContext.clearRect(0, 0, canvas.width, canvas.height);
	// x軸の線(横線)とラベル出力
	// Draw grid (Y)
	canvasContext.fillRect(graph_margin, graph_margin, canvas.width-graph_margin*2, 1);
	canvasContext.fillRect(graph_margin, (canvas.height)/2, canvas.width-graph_margin*2, 1);
	canvasContext.fillRect(graph_margin, canvas.height-graph_margin, canvas.width-graph_margin*2, 1);
	// Draw text (Y)
	
	// 500ms単位にy軸の線(縦線)とラベル出力
	for(var i=0;i*500<=recording_time;i++){
		//var text = (s < 1000) ? (s + ' ms') : ((s / 1000) + ' s');
		var text = String(i*0.5) + ' s';
		var x=graph_margin+((canvas.width-graph_margin*2)/(recording_time/500))*i;
		// Draw grid (X)
		canvasContext.fillRect(x, graph_margin, 1, canvas.height-graph_margin*2);
		// Draw text (X)
		canvasContext.fillText(text, x-8, canvas.height-graph_margin/2);
	}
	canvasContext.stroke();
	var elms = document.querySelectorAll(".result_is")
	elms.forEach(function (elm){
		var myText = elm.textContent;
		elm.innerHTML = null;
		myText.split("").forEach(function(c){
			elm.innerHTML += '<span class="fadein">'+c+'</span>';
		});
	});

	var animation = anime.timeline();
	var coin_txt = [".yen1",".yen5",".yen10",".yen50",".yen100",".yen500"];
	for(var i=0;i<6;i++){
		animation.add({
			targets:coin_txt[i],
			opacity:0.35,
			easing:"linear",
			duration:0
		});
	}
	
	animation.add({
		targets:".result_is",
		opacity:0,
		easing:"linear",
		autoplay:false,
		duration:0
	});
}

//. 録音
function Record(){
	navigator.mediaDevices.getUserMedia({ audio: true }).then(function( stream ){
    	//. 録音中の音声処理

    	//var options = {mimeType: 'video/webm;codecs=vp9'};
    	Initialize();
        const recordedChunks = [];
    	//var mediaRecorder = new MediaRecorder(stream, options);
    	var mediaRecorder = new MediaRecorder(stream);
    	// タイマーセット
    	timer_s = new Date();
    	// recording_time[ms]後に停止する処理
    	setTimeout(function(){stream.getAudioTracks()[0].stop(); mediaRecorder.stop(); scriptProcessor.onaudioprocess=null; scriptProcessor.disconnect(); scriptProcessor=null;}, recording_time);
    	
    	mediaRecorder.addEventListener('dataavailable', function(e) {
    	      if (e.data.size > 0) {
    	        recordedChunks.push(e.data);
    	      }
    	    });

    	//録音停止後の動作
    	mediaRecorder.addEventListener('stop', function() {
    		//録音音声の解析
        	setTimeout(function(){
        		var predCoin = coinEstimation(recordedChunks[0]);
        		console.log(timer-timer_s);
        		// 結果のコインを表示
        		showEstimatedCoin(predCoin);
        	},2000);
    	});
    	// 録音開始
    	mediaRecorder.start();
    	//タイマースタート
    	timer = timer_s;
    	// 繰り返し呼ばれる処理
    	// scriptProcessorのonAudioProcessとmediastreamsourceをつなげる
    	var scriptProcessor = audioContext.createScriptProcessor(bufferSize, 1, 1);
    	var mediastreamsource = audioContext.createMediaStreamSource(stream);
    	window.dotnsf_hack_for_mozzila = mediastreamsource;  //. https://support.mozilla.org/en-US/questions/984179
    	mediastreamsource.connect(scriptProcessor);
    	scriptProcessor.onaudioprocess = onAudioProcess;
    	scriptProcessor.connect(audioContext.destination);
      
    	// 音声解析データを取得
    	sampleRate = audioContext.sampleRate;
    	
    	audioAnalyser = audioContext.createAnalyser();
    	audioAnalyser.fftSize = 2048;
    	mediastreamsource.connect(audioAnalyser);
	}).catch(function( e ){
	      console.log( e );
	    });
}

//. 繰り返し呼ばれる処理
function onAudioProcess( e ){
	//録音処理
	//. 取得した周波数成分データ
    var spectrums = new Uint8Array(audioAnalyser.frequencyBinCount);
    var wave = new Uint8Array(audioAnalyser.frequencyBinCount);
    audioAnalyser.getByteFrequencyData(spectrums);
    audioAnalyser.getByteTimeDomainData(wave);
    // これまでのデータに追加
    audioData_spec.push(spectrums);
    Array.prototype.push.apply(audioData_wave,wave);
	
	// グラフの描画(音量を取ると同時にonFlagも設定)
	Draw_graph(wave);
}

// 録音中の音声の表示
var Draw_graph = function(wave){
	//キャンバス情報の取得
	var canvas = document.getElementById('canvas');
	var canvasContext = canvas.getContext('2d');
  
	//canvasContext.clearRect(0, 0, canvas.width, canvas.height);

	canvasContext.beginPath();
	var newTimer = new Date();
	if(newTimer>timer_s+recording_time){
		newTimer = timer_s + recording_time;
	}
	var xs = graph_margin + (canvas.width-graph_margin*2)*((timer-timer_s)/recording_time);
	var xe = graph_margin + (canvas.width-graph_margin*2)*((newTimer-timer_s)/recording_time);
	for (var i = 0; i < wave.length; i++) {
		//canvasにおさまるように線を描画
		var x = xs + (xe-xs)/wave.length*i;
		var y = canvas.height/2 + (wave[i]-128)/256 * canvas.height;
		if(y>canvas.height-graph_margin){
			y=canvas.height-graph_margin;
		}else if(y<graph_margin){
			y=graph_margin;
		}
		if (i === 0) {
			canvasContext.moveTo(x, y);
		} else {
			canvasContext.lineTo(x, y);
		}
	}
	canvasContext.stroke();
	timer = newTimer;
}

